import React, { FC } from "react";
import s from "./sideBar.module.css";
import { useSelector } from "react-redux";
import { NavLink } from "react-router-dom";
import { RootState } from "../../store/store";
import { UilHome, UilIcons, UilOperaAlt, UilPolygon } from "@iconscout/react-unicons";
import {
  List,
  ListItem,
  ListItemButton,
  ListItemIcon,
  ListItemText,
} from "@mui/material";

type SideBarProps = {};

export const SideBar: FC<SideBarProps> = (props) => {
  const sideBarData = useSelector((state: RootState) => state.sideBar);

  const navigationItemsForRender = sideBarData.map((navI) => {
    return (
      <ListItem disablePadding>
        <ListItemButton>
          <ListItemIcon>
            <UilIcons color="white"/>
          </ListItemIcon>
          <ListItemText primary={navI.title} color="black"/>
        </ListItemButton>
      </ListItem>
    );
  });
  return (
      <List sx={{bgcolor: "#161618", height: "100%"}}>{navigationItemsForRender}</List>
  );
};
